    false,nt"url": null,nt"notes": "This narrative report for Stillwater WMA,
    Anaho Island NWR, and Fallon NWR outlines Refuge accomplishments during the 1977-1979.
    The report begins with an introduction to the Refuge and information about weather
    conditions, habitat conditions, land acquisition activities, and the system status.
    Construction and maintenance are also described. Habitat management is covered;
    grasslands, wetlands, and wilderness areas are discussed. The wildlife section of
    the report discusses endangered and threatened species, migratory birds, mammals,
    and non-migratory birds. Interpretation and recreation activities are outlined;
    topics include information and interpretation, recreation, and law enforcement.
    Field investigations, cooperative programs, items of interest, safety information,
    and a report titled u201cStillwater Wildlife Management Area: Report on Wildlife
    Management Study: Monitoring Program of Wildlife Habitat and Associated Use in the
    Truckee-Carson Irrigation District, Nevadau201d are attached.",nt"license_title":
